import React, { Component } from "react";
import c from "../notes/c3/c.wav";
import d from "../notes/c3/d.wav";
import e from "../notes/c3/e.wav";
import f from "../notes/c3/f.wav";
import g from "../notes/c3/g.wav";
import a from "../notes/c3/a.wav";
import b from "../notes/c3/b.wav";

class GuessTheNote extends Component {
  render() {
    const playSound = (note) => {
      const audio = new Audio(note);
      audio.play();
    };

    const playD = () => {
      const audio = new Audio(d);
      audio.play();
    };

    const playE = () => {
      const audio = new Audio(e);
      audio.play();
    };

    const playF = () => {
      const audio = new Audio(f);
      audio.play();
    };

    const playG = () => {
      const audio = new Audio(g);
      audio.play();
    };

    const playA = () => {
      const audio = new Audio(a);
      audio.play();
    };

    const playB = () => {
      const audio = new Audio(b);
      audio.play();
    };

    return (
      <div className="guessTheNote">
        <button name="c" onClick={playSound(c)}> C </button>
        <button name="d" onClick={playSound(d)}> D </button>
        <button onClick={playSound}> E </button>
        <button onClick={playSound}> F </button>
        <button onClick={playSound}> G </button>
        <button onClick={playSound}> A </button>
        <button onClick={playSound}> B </button>
      </div>
    );
  }
}

export default GuessTheNote;
